Germania, anni Ottanta. Georg, famoso e apprezzato drammaturgo, si trasferisce insieme alla moglie Christa a Berlino Est. Un giorno il ministro tedesco della cultura si innamora di Christa dopo averla vista recitare e incarica Gerd Wielser, un suo agente fidato, di avvicinare la coppia e di spiarne ogni movimento. Gerd accetta di buon grado, ma non immagina che la sua vita sta per cambiare vertiginosamente...
